export default function NavButtons() {
  return (
    <>
      <div>
        <button type="button">
          <a
            href="https://about.google/?fg=1&utm_source=google-DE&utm_medium=referral&utm_campaign=hp-header"
            target="_blank"
          ></a>
        </button>
        <button type="button">Store</button>
      </div>
    </>
  );
}
